export const Data = [
    {
        questions: "What do you call a dog magician ?",
        answer: "A labracadabrador"
    },
    {
        questions: "What do you call a funny mountain ?",
        answer: "hill-arious"
    },
    {
        questions: "What did astronaut say when he crashed ?",
        answer: "I appolo-gize"
    },
];

export default Data;
